import React from 'react';
import { NavLink } from "react-router-dom";


function Header() {
    return (
        <header>
            <div id="logo">
            <h1>DunderList</h1>
            </div>
            <div id="navBar">
                <NavLink>Shop</NavLink>
                <NavLink>Sell</NavLink>
                <NavLink>About</NavLink>
                <NavLink>Cart</NavLink>
            </div>
        </header>
    )
}

export default Header
